import React from "react";

let CV = (props) => {
    const {personal, workExperiences, educationExperiences} = props;
    return (
        <div>
            <div className="header">
                <div className="name-title">
                    <h1>{personal.firstName}</h1>
                </div>
            </div>
        </div>
    )
}

export default CV;
